import React from 'react'

const Item = (props) => {
  return (
    <>
   
    
    <div>
   <Link to={`/product/${props.id}`}>  <img src={props.image }alt=""/></Link>
    <p>{props.name}</p>
    <div>
        <div>
            {props.new_price}
        </div>
        <div>
            {props.old_price}
        </div>
    </div>
   </div>
    </>
  )
}

export default Item
